import React, { useState } from 'react'
import Todolist from './TodoIist'
const Todo = () => {
    let [todo, setTodo] = useState("")
    let [item, setItem] = useState([])
    let handeleSubmit = (e) => {

        setItem((preVal) => {
            return [...preVal, todo]
        })
        setTodo("")
    }
    let getInputVal = (e) => {
        setTodo(e.target.value)
    }

    return (
        <div>
            <h1>Todo list</h1>
            <div className="todohead">

            </div>
           
            {item.map((item, i) => {
                    return <Todolist
                        key={i + 1}
                        item={item}
                        i={i}
                        setItem={setItem}
                    />
                })
            }

        </div>
    )
}

export default Todo
